import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Typography from '@material-ui/core/Typography';
import styled from 'styled-components';
import Box from '@material-ui/core/Box';

function DetailCatalog() {
  const useStyles = makeStyles(theme => ({
    root: {
      flexGrow: 1,
      marginTop: '90px'
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary
    }
  }));
  const WrapPadding = styled.div`
    padding-top: 20px;
  `;
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <Container>
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <img
              src="./assets/img/image4.JPG"
              class="img-fluid"
              alt="Responsive image"
            />
          </Grid>
          <Grid item xs={6}>
            <Typography variant="h5" className="titleCatalog">
              Safina
            </Typography>
            <div className="hr"></div>
            <WrapPadding>
              <p className="price">Rp 400.000</p>
            </WrapPadding>
            <WrapPadding>
              <p className="price">Pilih size *</p>
              <Box display="flex" flexDirection="row">
                <Box p={1}>
                  <div className="boxSize">item 1</div>
                </Box>
                <Box p={1}>item 2</Box>
                <Box p={1}>item 3</Box>
              </Box>
            </WrapPadding>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}

export default DetailCatalog;
